import React from "react";
import {  
  Card,
  CardImg,
  CardText,
  CardBody,
  CardTitle,
  CardSubtitle,
  Button,
} from "reactstrap";

const Stadiums = () => {
  return (
    <div>
      <Card sm='5'>
        <CardImg top width="50%" src="" alt="Card image cap" sm='5'/>
        <CardBody sm='5'>
          <CardTitle>Maracana-Ezzahra</CardTitle>
          <CardSubtitle>Ben Arous</CardSubtitle>
          <CardText>
            25 Rue chedly hamouda
          </CardText>
          <Button>Access</Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default Stadiums;
